import {BaseThunkType, InferActionsTypes} from "../Redux-store";

interface infoType {
    id: number,
    number: number
}
interface cars {
    mainImg: string,
    nameOfFolder: string,
    Cars: Array<infoType>
}

let initialState = {
    ArrayFolders:[
        {
            mainImg: '',
            nameOfFolder: 'folder',
            Cars:[
                {id:1, number: 334443113},
                {id:2, number: 334443115},
            ] as Array<infoType>
        },
        {
            mainImg: '' as string | null,
            nameOfFolder: 'folder' as string,
            Cars:[
                {id:3, number: 334443118},
                {id:4, number: 334443119},
            ] as Array<infoType>
        }
    ] as Array<cars>

}
type InitialState = typeof initialState;
export const folderReducer = (state=initialState, action:ActionsTypes):InitialState =>{

    switch (action.type) {
        default: {
            return state;
        }
    }
}

export const actions = {
    changeUrl: (url:string | number) => ({type: 'newURL', url} as const)
}




type ActionsTypes = InferActionsTypes<typeof actions>
type ThunkType = BaseThunkType<ActionsTypes>
